var pages;
    for(var page=1;page<=100;page++){
        var now=0;
        if(page==1){
    		var single_list_start=document.getElementById("fda");
    	}
    	else{
    		var single_list_start=document.getElementsByClassName("fda_"+page)[0];
    	}
    	var drug_list_contant = single_list_start.getElementsByClassName("contant")[0];
        now+=drug_list_contant.getElementsByTagName("img")[0].offsetHeight;
        var computedStyle = document.defaultView.getComputedStyle(drug_list_contant.getElementsByTagName("img")[0],null);
        if(computedStyle.marginTop!=""){
            now+=parseInt(computedStyle.marginTop);
        }
        if(computedStyle.marginBottom!=""){
            now+=parseInt(computedStyle.marginBottom);
        }
        if(page==1){
           now+=drug_list_contant.getElementsByClassName("title")[0].offsetHeight;
             var computedStyle = document.defaultView.getComputedStyle(drug_list_contant.getElementsByClassName("title")[0],null);
             if(computedStyle.marginTop!=""){
                 now+=parseInt(computedStyle.marginTop);
             }
             if(computedStyle.marginBottom!=""){
                 now+=parseInt(computedStyle.marginBottom);
             }
        }
        now+=54;
        var length_table=drug_list_contant.getElementsByTagName("table")[0].getElementsByTagName("tr").length;
        for(k=1;k<=length_table;k++){
            now+=drug_list_contant.getElementsByTagName("table")[0].getElementsByTagName("tr")[k-1].offsetHeight;
            var computedStyle = document.defaultView.getComputedStyle(drug_list_contant.getElementsByTagName("table")[0].getElementsByTagName("tr")[k-1],null);
            if(computedStyle.marginTop!=""){
                now+=parseInt(computedStyle.marginTop);
            }
            if(computedStyle.marginBottom!=""){
                now+=parseInt(computedStyle.marginBottom);
            }
            if(now>=1992){
                suzhu=k;
                break;
            }
        }
        if(k<=length_table){
            var newDiv_wrap = document.createElement("div");
            newDiv_wrap.setAttribute("class","fda_" + (page + 1) +" fda");//为创建的新元素添加属性
            var newDiv=document.createElement("div");
            newDiv.setAttribute("class","contant");//为创建的新元素添加属性
            var newimg=document.createElement("img");
            newimg.setAttribute("src","daanImg/da180_head.png");
            newDiv.appendChild(newimg);
            newDiv_wrap.appendChild(newDiv);
            insertAfter(newDiv_wrap,drug_list);
            single_list_pagejia1=document.getElementsByClassName("fda_"+(page+1)+"")[0].getElementsByClassName("contant")[0];
            var newtable=document.createElement("table");
            newtable.setAttribute("class", "tab");
            newtable.setAttribute("cellspacing","0");
            newtable.setAttribute("cellpadding","0");
            var newtbody=document.createElement("tbody");
            newtable.appendChild(newtbody);
            single_list_pagejia1.appendChild(newtable);
            for(i=suzhu;i<=length_table;i++){
                single_list_pagejia1.getElementsByTagName("table")[0].getElementsByTagName("tbody")[0].appendChild(drug_list_contant.getElementsByTagName("table")[0].getElementsByTagName("tr")[suzhu-1]);
            }
            var newDiv_yejiao = document.createElement("div");
            newDiv_yejiao.setAttribute("class", "yejiao");//为创建的新元素添加属性
            var newDiv = document.createElement("div");
            var newtxt=document.createTextNode("此报告仅对送检标本负责！结果仅供医生参考，如对检测结果有疑问，请收到报告7个工作日内与我们联系，谢谢！");
            newDiv.appendChild(newtxt);
            newDiv_yejiao.appendChild(newDiv);
            var newye=document.createElement("div");
            newye.setAttribute("class","yema");//为创建的新元素添加属性
            newDiv_yejiao.appendChild(newye);
            newDiv_wrap.appendChild(newDiv_yejiao);
        }else {
            pages=page;
            break;
        }
    }